CREATE DATABASE `MARINE_NATIONALE`

CREATE TABLE `mailing_lists` (
  `IdListe` int(11) NOT NULL AUTO_INCREMENT,
  `Nom` varchar(100) NOT NULL,
  `Liste` longtext NOT NULL,
  `DateCrea` date DEFAULT NULL,
  PRIMARY KEY (`IdListe`)
) ENGINE=InnoDB AUTO_INCREMENT=29 DEFAULT CHARSET=latin1


CREATE TABLE `marche` (
  `IdMarche` int(1) DEFAULT NULL,
  `Nom` varchar(18) DEFAULT NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8


CREATE TABLE `prescripteurs` (
  `id` int(50) NOT NULL AUTO_INCREMENT,
  `IdMarche` int(10) DEFAULT NULL,
  `CIRFA` varchar(50) DEFAULT NULL,
  `Departement` varchar(50) DEFAULT NULL,
  `Nom` varchar(255) DEFAULT NULL,
  `Organisme` varchar(255) DEFAULT NULL,
  `Activite` varchar(255) DEFAULT NULL,
  `Domaine` text DEFAULT NULL,
  `TypeScolarite` varchar(50) DEFAULT NULL,
  `Population` int(11) DEFAULT 0,
  `Adresse` text DEFAULT NULL,
  `Contact` varchar(255) DEFAULT NULL,
  `Role` varchar(255) DEFAULT NULL,
  `Mail` varchar(255) DEFAULT NULL,
  `Tel` varchar(100) DEFAULT NULL,
  `Tel2` varchar(50) DEFAULT NULL,
  `SiteWeb` text DEFAULT NULL,
  `Commentaire` text DEFAULT NULL,
  `DernierContact` varchar(100) DEFAULT NULL,
  `Source` text DEFAULT NULL,
  `Interet` int(11) DEFAULT 0,
  `DateCrea` date DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=6746 DEFAULT CHARSET=utf8


CREATE TABLE `templates` (
  `IdTemplate` int(11) NOT NULL AUTO_INCREMENT,
  `NomTemplate` varchar(100) NOT NULL,
  `TexteMail` longtext NOT NULL,
  `DateCrea` date DEFAULT NULL,
  PRIMARY KEY (`IdTemplate`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=latin1


CREATE TABLE `Candidats` (
  `IdCandidat` int(11) NOT NULL
) ENGINE=MyISAM AUTO_INCREMENT=6746 DEFAULT CHARSET=utf8




